@CBoy287 @mahesh_shenai @ScienceMagazine BTW this paper did an experiment to mimic the evolution of new variants, challenging with:
(1) A/California/7/2009 virus with antigenetically matching HA
(2) A/PuertoRico/8/1934 virus, an H1N1 within the clade but antigenetically distinct from the vaccine (81.9% HA homology)
